PropDefinitions:
  absorbed_dose_to_meterset_ratio:
    Desc: Ratio of absorbed dose in Gy to Meterset as defined by Primary Dosimeter
      Unit (300A,00B3) in the reference conditions.
    Tags:
      dicom_name: Absorbed Dose to Meterset Ratio
      dicom_tag: (300C,0121)
      dicom_type: attribute
    Type: TBD
  accession_number:
    Desc: A departmental Information System generated number that identifies the Imaging
      Service Request.
    Tags:
      dicom_name: Accession Number
      dicom_tag: (0008,0050)
      dicom_type: attribute
    Type: TBD
  accessory_code:
    Desc: An identifier for the accessory intended to be read by a device such as
      a bar-code reader.
    Tags:
      dicom_name: Accessory Code
      dicom_tag: (300A,00F9)
      dicom_type: attribute
    Type: TBD
  acquired_subtraction_mask_flag:
    Desc: Identifies that the device acquired mask images for subtraction.
    Tags:
      dicom_name: Acquired Subtraction Mask Flag
      dicom_tag: (0018,11B2)
      dicom_type: attribute
    Type: TBD
  acquisition_contrast:
    Desc: Indication of acquisition contrast used with frames in the SOP Instance.
      See  for a description and Defined Terms.
    Tags:
      dicom_name: Acquisition Contrast
      dicom_tag: (0008,9209)
      dicom_type: attribute
    Type: TBD
  acquisition_date:
    Desc: The date the acquisition of data that resulted in this image started. See  for
      specialization.
    Tags:
      dicom_name: Acquisition Date
      dicom_tag: (0008,0022)
      dicom_type: attribute
    Type: TBD
  acquisition_datetime:
    Desc: The date and time that the acquisition of data started.The synchronization
      of this time with an external clock is specified in the  in Acquisition Time
      Synchronized (0018,1800).
    Tags:
      dicom_name: Acquisition DateTime
      dicom_tag: (0008,002A)
      dicom_type: attribute
    Type: TBD
  acquisition_device_processing_code:
    Desc: Code representing the device-specific processing associated with the image
      (e.g., Organ Filtering code)This Code is manufacturer specific but provides
      useful annotation information to the knowledgeable observer.
    Tags:
      dicom_name: Acquisition Device Processing Code
      dicom_tag: (0018,1401)
      dicom_type: attribute
    Type: TBD
  acquisition_device_processing_description:
    Desc: Indicates any visual processing performed on the images prior to exchange.See  for
      further explanation.
    Tags:
      dicom_name: Acquisition Device Processing Description
      dicom_tag: (0018,1400)
      dicom_type: attribute
    Type: TBD
  acquisition_duration:
    Desc: The scan time in seconds used to create all frames of an Ophthalmic Tomography
      image.Required if Image Type (0008,0008) Value 1 is ORIGINAL. May be present
      otherwise.
    Tags:
      dicom_name: Acquisition Duration
      dicom_tag: (0018,9073)
      dicom_type: attribute
    Type: TBD
  acquisition_field_of_view_label:
    Desc: Manufacturer-defined name of the Field of View label displayed on the acquisition
      console. Each label corresponds to a FOV dimension applied during the acquisition.
    Tags:
      dicom_name: Acquisition Field Of View Label
      dicom_tag: (0018,11BB)
      dicom_type: attribute
    Type: TBD
  acquisition_matrix:
    Desc: 'Dimensions of the acquired frequency /phase data before reconstruction.Multi-valued:
      frequency rows\frequency columns\phase rows\phase columns.'
    Tags:
      dicom_name: Acquisition Matrix
      dicom_tag: (0018,1310)
      dicom_type: attribute
    Type: TBD
  acquisition_mode:
    Desc: Manufacturer-defined name of the acquisition mode described by this Protocol
      Element.
    Tags:
      dicom_name: Acquisition Mode
      dicom_tag: (0018,11B0)
      dicom_type: attribute
    Type: TBD
  acquisition_motion:
    Desc: Motion of scan progression.See .The value of NOT_IMPORTANT is not permitted
      in the Performed Procedure Protocol IOD.
    Tags:
      dicom_name: Acquisition Motion
      dicom_tag: (0018,9930)
      dicom_type: attribute
    Type: TBD
  acquisition_number:
    Desc: A number identifying the single continuous gathering of data over a period
      of time that resulted in this image.
    Tags:
      dicom_name: Acquisition Number
      dicom_tag: (0020,0012)
      dicom_type: attribute
    Type: TBD
  acquisition_start_condition:
    Desc: Description of how the data collection was started.See  for Defined Terms.Required
      if Image Type (0008,0008) Value 1 is ORIGINAL. May be present otherwise.
    Tags:
      dicom_name: Acquisition Start Condition
      dicom_tag: (0018,0073)
      dicom_type: attribute
    Type: TBD
  acquisition_start_condition_data:
    Desc: Count density, change in count density, or physiological triggers causing
      data collection to start.
    Tags:
      dicom_name: Acquisition Start Condition Data
      dicom_tag: (0018,0074)
      dicom_type: attribute
    Type: TBD
  acquisition_termination_condition:
    Desc: Description of how the data collection for the Series was stopped.See  for
      Defined Terms.Required if Image Type (0008,0008) Value 1 is ORIGINAL. May be
      present otherwise.
    Tags:
      dicom_name: Acquisition Termination Condition
      dicom_tag: (0018,0071)
      dicom_type: attribute
    Type: TBD
  acquisition_termination_condition_data:
    Desc: Number of counts, count density, change in count density, or physiological
      triggers causing the termination.
    Tags:
      dicom_name: Acquisition Termination Condition Data
      dicom_tag: (0018,0075)
      dicom_type: attribute
    Type: TBD
  acquisition_time:
    Desc: The time the acquisition of data that resulted in this image started. See  for
      specialization.
    Tags:
      dicom_name: Acquisition Time
      dicom_tag: (0008,0032)
      dicom_type: attribute
    Type: TBD
  acquisition_time_synchronized:
    Desc: 'Acquisition DateTime (0008,002A) synchronized with external time reference.See '
    Tags:
      dicom_name: Acquisition Time Synchronized
      dicom_tag: (0018,1800)
      dicom_type: attribute
    Type: TBD
  acquisition_type:
    Desc: Description of the method used during acquisition of this frame. See  for
      Defined Terms.Required if Frame Type (0008,9007) Value 1 of this frame is ORIGINAL.
      May be present otherwise.
    Tags:
      dicom_name: Acquisition Type
      dicom_tag: (0018,9302)
      dicom_type: attribute
    Type: TBD
  actual_frame_duration:
    Desc: Elapsed time of the data acquisition for this image, in msec. See  for explanation.
    Tags:
      dicom_name: Actual Frame Duration
      dicom_tag: (0018,1242)
      dicom_type: attribute
    Type: TBD
  additional_patient_history:
    Desc: Additional information about the Patient's medical history.
    Tags:
      dicom_name: Additional Patient History
      dicom_tag: (0010,21B0)
      dicom_type: attribute
    Type: TBD
  admitting_date:
    Desc: Date Patient Visit began
    Tags:
      dicom_name: Admitting Date
      dicom_tag: (0038,0020)
      dicom_type: attribute
    Type: TBD
  admitting_diagnoses_description:
    Desc: Description of the admitting diagnosis (diagnoses)
    Tags:
      dicom_name: Admitting Diagnoses Description
      dicom_tag: (0008,1080)
      dicom_type: attribute
    Type: TBD
  admitting_time:
    Desc: Time Patient Visit began
    Tags:
      dicom_name: Admitting Time
      dicom_tag: (0038,0021)
      dicom_type: attribute
    Type: TBD
  algorithm_name:
    Desc: The name assigned by a manufacturer to a specific software algorithm.
    Tags:
      dicom_name: Algorithm Name
      dicom_tag: (0066,0036)
      dicom_type: attribute
    Type: TBD
  algorithm_parameters:
    Desc: The input parameters used by a manufacturer to configure the behavior of
      a specific software algorithm.
    Tags:
      dicom_name: Algorithm Parameters
      dicom_tag: (0066,0032)
      dicom_type: attribute
    Type: TBD
  algorithm_source:
    Desc: Source of the algorithm, e.g., the name of the manufacturer, researcher,
      university, etc.
    Tags:
      dicom_name: Algorithm Source
      dicom_tag: (0024,0202)
      dicom_type: attribute
    Type: TBD
  algorithm_type:
    Desc: Type of algorithm used to create the 3D reconstruction.
    Tags:
      dicom_name: Algorithm Type
      dicom_tag: '(0018,9527) '
      dicom_type: attribute
    Type: TBD
  algorithm_version:
    Desc: The software version identifier assigned by a manufacturer to a specific
      software algorithm.
    Tags:
      dicom_name: Algorithm Version
      dicom_tag: (0066,0031)
      dicom_type: attribute
    Type: TBD
  allergies:
    Desc: Description of prior reaction to contrast agents, or other patient allergies
      or adverse reactions.
    Tags:
      dicom_name: Allergies
      dicom_tag: (0010,2110)
      dicom_type: attribute
    Type: TBD
  alpha_lut_transfer_function:
    Desc: Specifies the transformation that is used to create the Alpha input to the
      Blending LUTs.Depending on the values of Blending LUT 1 Transfer Function (0028,1405)
      and Blending LUT 2 Transfer Function (0028,140D) the Alpha LUT value may be
      ignored. It is recommended that IDENTITY be used if this is the case.
    Tags:
      dicom_name: Alpha LUT Transfer Function
      dicom_tag: (0028,1410)
      dicom_type: attribute
    Type: TBD
  alpha_palette_color_lookup_table_data:
    Desc: Alpha LUT contains the blending values for the data frames.Required if Alpha
      LUT Transfer Function (0028,1410) is TABLE.
    Tags:
      dicom_name: Alpha Palette Color Lookup Table Data
      dicom_tag: (0028,1204)
      dicom_type: attribute
    Type: TBD
  alpha_palette_color_lookup_table_descriptor:
    Desc: Specifies the format of the Alpha Palette Color Lookup Table Data.The second
      value (first stored pixel value mapped) shall be zero.Required if Alpha LUT
      Transfer Function (0028,1410) is TABLE.
    Tags:
      dicom_name: Alpha Palette Color Lookup Table Descriptor
      dicom_tag: (0028,1104)
      dicom_type: attribute
    Type: TBD
  alternate_beam_dose:
    Desc: Alternate Dose (in Gy) according to the Alternate Beam Dose Type (300A,0092).See
      Note 9.
    Tags:
      dicom_name: Alternate Beam Dose
      dicom_tag: (300A,0091)
      dicom_type: attribute
    Type: TBD
  alternate_beam_dose_type:
    Desc: Type of Dose of the Alternate Beam Dose (300A,0091).Shall not have the same
      value as Beam Dose Type (300A,0090).Required if Alternate Beam Dose (300A,0091)
      is present.
    Tags:
      dicom_name: Alternate Beam Dose Type
      dicom_tag: (300A,0092)
      dicom_type: attribute
    Type: TBD
  anatomical_orientation_type:
    Desc: The anatomical orientation type used in Instances generated by this equipment.Required
      if the Patient is an animal and the anatomical Frame of Reference is not bipedal.
      May be present otherwise. See  and .If this Attribute is not present, the default
      human standard anatomical position is used to define the patient orientation
      of projection images and the Patient-Based Coordinate System of cross-sectional
      images.
    Tags:
      dicom_name: Anatomical Orientation Type
      dicom_tag: (0010,2210)
      dicom_type: attribute
    Type: TBD
  anchor_point:
    Desc: Location of a point in the image or Specified Displayed Area to which the
      Unformatted Text Value (0070,0006) is related, in Anchor Point Annotation Units
      (0070,0004), given as column\row. Column is the horizontal offset and row is
      the vertical offset.Required if Bounding Box Top Left Hand Corner (0070,0010)
      and Bounding Box Bottom Right Hand Corner (0070,0011) are not present. May be
      present otherwise.
    Tags:
      dicom_name: Anchor Point
      dicom_tag: (0070,0014)
      dicom_type: attribute
    Type: TBD
  anchor_point_annotation_units:
    Desc: Units of measure for the axes of the text anchor point annotation.Enumerated
      Values for Anchor Point Annotation Units (0070,0004) are the same as for Bounding
      Box Annotation Units (0070,0003).Required if Anchor Point (0070,0014) is present.
    Tags:
      dicom_name: Anchor Point Annotation Units
      dicom_tag: (0070,0004)
      dicom_type: attribute
    Type: TBD
  anchor_point_visibility:
    Desc: Flag to indicate whether or not a visible indication (such as a line or
      arrow) of the relationship between the text and the anchor point is to be displayed.Required
      if Anchor Point (0070,0014) is present.
    Tags:
      dicom_name: Anchor Point Visibility
      dicom_tag: (0070,0015)
      dicom_type: attribute
    Type: TBD
  angio_flag:
    Desc: Angio Image Indicator. Primary image for Angio processing.
    Tags:
      dicom_name: Angio Flag
      dicom_tag: (0018,0025)
      dicom_type: attribute
    Type: TBD
  angular_step:
    Desc: The angular scan arc step between views of the TOMO acquisition, in degrees.
      See  for further explanation.
    Tags:
      dicom_name: Angular Step
      dicom_tag: (0018,1144)
      dicom_type: attribute
    Type: TBD
  angular_view_vector:
    Desc: An array that contains the angular view number for each frame. Required
      if the value of Frame Increment Pointer (0028,0009) includes the Tag for Angular
      View Vector (0054,0090). See  for specialization.
    Tags:
      dicom_name: Angular View Vector
      dicom_tag: (0054,0090)
      dicom_type: attribute
    Type: TBD
  annotation_display_format_id:
    Desc: Identification of annotation display format. The definition of the annotation
      display formats and the annotation box position Sequence are defined in the
      Conformance Statement
    Tags:
      dicom_name: Annotation Display Format ID
      dicom_tag: (2010,0030)
      dicom_type: attribute
    Type: TBD
  annotation_group_number:
    Desc: Number identifying associated annotations (see ).
    Tags:
      dicom_name: Annotation Group Number
      dicom_tag: (0040,A180)
      dicom_type: attribute
    Type: TBD
  anode_target_material:
    Desc: The primary material in the anode of the X-Ray source.
    Tags:
      dicom_name: Anode Target Material
      dicom_tag: (0018,1191)
      dicom_type: attribute
    Type: TBD
  applicable_frame_range:
    Desc: Each pair of numbers in this multi-valued Attribute specify a beginning
      and ending frame number inclusive of a range where this particular mask operation
      is valid. Discontinuous ranges are represented by multiple pairs of numbers.
      Frames in a Multi-frame Image are specified by sequentially increasing number
      values beginning with 1. If this Attribute is missing in this particular Sequence
      Item, then the mask operation is applicable throughout the entire Multi-frame
      Image, subject to certain limits as described in .Required if Mask Operation
      (0028,6101) equals REV_TID. May be present otherwise.
    Tags:
      dicom_name: Applicable Frame Range
      dicom_tag: (0028,6102)
      dicom_type: attribute
    Type: TBD
  applicable_safety_standard_agency:
    Desc: Agency that established MR safety standard applicable to the acquisition
      of this Instance.Required if SOP Class UID is not "1.2.840.10008.5.1.4.1.1.4.4"
      (Legacy Converted). May be present otherwise.
    Tags:
      dicom_name: Applicable Safety Standard Agency
      dicom_tag: (0018,9174)
      dicom_type: attribute
    Type: TBD
  applicator_aperture_shape:
    Desc: Aperture shape of the applicator.
    Tags:
      dicom_name: Applicator Aperture Shape
      dicom_tag: (300A,0432)
      dicom_type: attribute
    Type: TBD
  applicator_description:
    Desc: User-defined description for Applicator.
    Tags:
      dicom_name: Applicator Description
      dicom_tag: (300A,010A)
      dicom_type: attribute
    Type: TBD
  applicator_id:
    Desc: User or machine supplied identifier for Applicator.
    Tags:
      dicom_name: Applicator ID
      dicom_tag: (300A,0108)
      dicom_type: attribute
    Type: TBD
  applicator_opening:
    Desc: Opening (in mm) of the applicator's aperture in IEC BEAM LIMITING DEVICE
      coordinate system. In case of square-shaped applicator contains the length of
      the sides of the square. In case of circular-shaped applicators, contains the
      diameter of the circular aperture.Required if Applicator Aperture Shape (300A,0432)
      is SYM_SQUARE or SYM_CIRCULAR.
    Tags:
      dicom_name: Applicator Opening
      dicom_tag: (300A,0433)
      dicom_type: attribute
    Type: TBD
  applicator_opening_x:
    Desc: Opening (in mm) of the applicator's aperture in IEC BEAM LIMITING DEVICE
      coordinate system in X-Direction.Required if Applicator Aperture Shape (300A,0432)
      is SYM_RECTANGLE.
    Tags:
      dicom_name: Applicator Opening X
      dicom_tag: (300A,0434)
      dicom_type: attribute
    Type: TBD
  applicator_opening_y:
    Desc: Opening (in mm) of the applicator's aperture in IEC BEAM LIMITING DEVICE
      coordinate system in Y-Direction.Required if Applicator Aperture Shape (300A,0432)
      is SYM_RECTANGLE.
    Tags:
      dicom_name: Applicator Opening Y
      dicom_tag: (300A,0435)
      dicom_type: attribute
    Type: TBD
  applicator_type:
    Desc: Type of applicator.
    Tags:
      dicom_name: Applicator Type
      dicom_tag: (300A,0109)
      dicom_type: attribute
    Type: TBD
  applied_mask_subtraction_flag:
    Desc: Identifies that a subtraction mask was applied.
    Tags:
      dicom_name: Applied Mask Subtraction Flag
      dicom_tag: (0018,11C0)
      dicom_type: attribute
    Type: TBD
  approval_status:
    Desc: Approval status at the time the SOP Instance was created.
    Tags:
      dicom_name: Approval Status
      dicom_tag: (300E,0002)
      dicom_type: attribute
    Type: TBD
  archive_requested:
    Desc: The Instances in this Series are expected to be archived in the long term
      archive.
    Tags:
      dicom_name: Archive Requested
      dicom_tag: (0040,A494)
      dicom_type: attribute
    Type: TBD
  attenuation_corrected:
    Desc: Attenuation (ATTN) correction has been applied to image.
    Tags:
      dicom_name: Attenuation Corrected
      dicom_tag: (0018,9759)
      dicom_type: attribute
    Type: TBD
  attenuation_correction_method:
    Desc: A textual description of the attenuation correction processing. e.g., measured
      vs. calculated, transmission source type (ring, line, point), assumed patient
      geometry (polygon, ellipse, segmented, attenuation coefficient, skull thickness),
      post-injection transmission, smoothing.
    Tags:
      dicom_name: Attenuation Correction Method
      dicom_tag: (0054,1101)
      dicom_type: attribute
    Type: TBD
  auto_kvp_lower_bound:
    Desc: Lower limit on the value of the auto-selected kVp.Constraints on KVP (0018,0060)
      represent constraints on the nominal KVP for the scan. Auto KVP Lower Bound
      (0018,9946) represents a direct constraint on the range of values that may be
      produced by the automated selection of the kVp value.
    Tags:
      dicom_name: Auto KVP Lower Bound
      dicom_tag: (0018,9946)
      dicom_type: attribute
    Type: TBD
  auto_kvp_selection_type:
    Desc: The type of automated selection of the kVp value.
    Tags:
      dicom_name: Auto KVP Selection Type
      dicom_tag: (0018,9944)
      dicom_type: attribute
    Type: TBD
  auto_kvp_upper_bound:
    Desc: Upper limit on the value of the auto-selected kVp.Constraints on KVP (0018,0060)
      represent constraints on the nominal KVP for the scan. Auto KVP Upper Bound
      (0018,9945) represents a direct constraint on the range of values that may be
      produced by the automated selection of the kVp value.
    Tags:
      dicom_name: Auto KVP Upper Bound
      dicom_tag: (0018,9945)
      dicom_type: attribute
    Type: TBD
  average_pulse_width:
    Desc: Average width of X-Ray pulse in msec.
    Tags:
      dicom_name: Average Pulse Width
      dicom_tag: (0018,1154)
      dicom_type: attribute
    Type: TBD
